import React from "react";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

export default function Landing() {
  const nav = useNavigate();

  return (
    <div style={{
      background: "#000",
      minHeight: "100vh",
      color: "#fff",
      fontFamily: "'Orbitron', 'Rajdhani', sans-serif",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      position: "relative",
      overflow: "hidden"
    }}>
      {/* Background Glow Effects */}
      <div style={{
        position: "absolute",
        top: "20%",
        left: "10%",
        width: "600px",
        height: "600px",
        background: "radial-gradient(circle, #ff69b4 10%, transparent 70%)",
        opacity: 0.4,
        filter: "blur(100px)"
      }} />
      <div style={{
        position: "absolute",
        bottom: "10%",
        right: "10%",
        width: "700px",
        height: "700px",
        background: "radial-gradient(circle, #00ffcc 10%, transparent 70%)",
        opacity: 0.4,
        filter: "blur(120px)"
      }} />

      {/* Main Content */}
      <motion.div
        initial={{ opacity: 0, scale: 0.8 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 1.5 }}
        style={{
          textAlign: "center",
          zIndex: 10,
          maxWidth: "900px",
          padding: "40px"
        }}
      >
        {/* Title - Squid Game Style */}
        <motion.h1
          initial={{ y: -100 }}
          animate={{ y: 0 }}
          transition={{ duration: 1, type: "spring", stiffness: 100 }}
          style={{
            fontSize: "clamp(60px, 12vw, 120px)",
            fontWeight: "900",
            margin: "0 0 30px",
            background: "linear-gradient(45deg, #ff6b35, #ff0044, #ff69b4)",
            WebkitBackgroundClip: "text",
            WebkitTextFillColor: "transparent",
            textShadow: "0 0 80px rgba(255,107,53,0.8), 0 0 120px rgba(255,105,180,0.6)",
            letterSpacing: "8px",
            lineHeight: "1.1"
          }}
        >
          THINKFAST
        </motion.h1>

        <motion.h2
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.8 }}
          style={{
            fontSize: "clamp(28px, 5vw, 48px)",
            color: "#ff6b35",
            margin: "20px 0 60px",
            fontWeight: "bold",
            letterSpacing: "3px"
          }}
        >
          QUIZ PLATFORM
        </motion.h2>

        {/* Subtitle */}
        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 1.2 }}
          style={{
            fontSize: "clamp(18px, 3vw, 28px)",
            color: "#ccc",
            margin: "40px 0 80px",
            lineHeight: "1.6"
          }}
        >
          Fast • Smart • Deadly<br />
          Only the strongest survive.
        </motion.p>

        {/* Buttons - Squid Game Style */}
        <div style={{ display: "flex", gap: "40px", justifyContent: "center", flexWrap: "wrap" }}>
          {/* LOGIN - Cyan Guard Style */}
          <motion.button
            whileHover={{ scale: 1.1, boxShadow: "0 0 60px #00ffcc" }}
            whileTap={{ scale: 0.95 }}
            onClick={() => nav("/login")}
            style={{
              padding: "22px 70px",
              fontSize: "28px",
              background: "#00ffcc",
              color: "#000",
              border: "none",
              borderRadius: "16px",
              fontWeight: "bold",
              cursor: "pointer",
              boxShadow: "0 0 50px #00ffcc",
              textTransform: "uppercase",
              letterSpacing: "4px",
              minWidth: "250px"
            }}
          >
            Login
          </motion.button>

          {/* SIGNUP - Pink Guard Style */}
          <motion.button
            whileHover={{ scale: 1.1, boxShadow: "0 0 60px #ff69b4" }}
            whileTap={{ scale: 0.95 }}
            onClick={() => nav("/register")}
            style={{
              padding: "22px 70px",
              fontSize: "28px",
              background: "#ff69b4",
              color: "white",
              border: "none",
              borderRadius: "16px",
              fontWeight: "bold",
              cursor: "pointer",
              boxShadow: "0 0 50px #ff69b4",
              textTransform: "uppercase",
              letterSpacing: "4px",
              minWidth: "250px"
            }}
          >
            Join Game
          </motion.button>
        </div>

        {/* Warning Text */}
        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 0.9 }}
          transition={{ delay: 1.8 }}
          style={{
            marginTop: "100px",
            color: "#ff3366",
            fontSize: "20px",
            fontWeight: "bold",
            letterSpacing: "2px"
          }}
        >
          Warning: Once you enter, there is no turning back.
        </motion.p>
      </motion.div>

      {/* Animated Circle Guard (Background) */}
      <motion.div
        animate={{
          rotate: 360,
          scale: [1, 1.2, 1]
        }}
        transition={{
          rotate: { duration: 30, repeat: Infinity, ease: "linear" },
          scale: { duration: 8, repeat: Infinity }
        }}
        style={{
          position: "absolute",
          width: "800px",
          height: "800px",
          border: "4px solid rgba(255,105,180,0.3)",
          borderRadius: "50%",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
          opacity: 0.2,
          pointerEvents: "none"
        }}
      />
    </div>
  );
}
